import { useState, useEffect } from 'react';

export function Test() {
  const [fileContent, setFileContent] = useState('');

  useEffect(() => {
    fetch('./planets.txt')
      .then(response => response.text())
      .then(data => setFileContent(data))
      .catch(error => console.log(error));
  }, []);

  return fileContent;
}
